import React from 'react';
import {CustomNavbar} from './CustomDrawers';
import Box from '@mui/material/Box';
import AppBar from '@mui/material/Box';
import {Typography} from '@mui/material';

// import {useNavigate} from "react-router-dom";

/**
 * Home Component
 * @return {object} JSX
 */
function Home() {
  // const navigate = useNavigate();
  console.log(__dirname);
  console.log('hello!');
  return (
      <Box>
        <AppBar />
        <CustomNavbar />
        <Box name= 'content' sx={{display: 'flex', alignItems: 'center',
          flexDirection: 'column'}}>
          {/* Top Box */}
          <Box sx={{display: 'flex', minWidth: 900, width: '90%',
            height: 500, mt: 5, flexDirection: 'row', flexWrap: 'wrap'}}
          backgroundColor = 'tertiary.main'>
            <img src="adam.png" width = '40%' height = '20%'/>
            <Typography variant = 'p1'>
            Hello There! <br />
            I'm Adam Hammond, <br />
            I am a 3rd Year Computer Science student from UC Santa Cruz.
            I'm interested in Distributed Systems, Algorithms, Machine Learning,
            Statistics, and Networking!
            </Typography>
          </Box>
          <Box name= 'content' sx={{display: 'flex', justifyContent: 'center',
          flexDirection: 'row', minWidth: 900, width: '90%', mt: 5}}>
            {/* Hello Box */}
            <Box sx={{display: 'flex', width: '100%', height: 500}}
            backgroundColor = 'primary.main'>
            </Box>
            <Box sx={{display: 'flex', width: '100%', height: 300}}
              backgroundColor = 'secondary.contrastText'>
            </Box>
          </Box>
        </Box>
      </Box>
  );
}

export default Home;
